import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Link } from 'react-router-dom'
import { fetchProducts } from '../actions';
import { Card, CardHeader, Row, Col, Table } from 'reactstrap';
const selector = state => ({
    products: state.get('products'),
})

class ProductDetail extends Component {
    constructor(props) {
        super(props);
        const { products, match: { params: { name } } } = props;
        this.state = {
            product: products.filter((h)=> h.getIn(['name'])===name)
            //product: products.find((h)=> h.getIn(['name'])===name)
        };
    }

    componentWillMount() {
        const { props: { dispatch } } = this;
        dispatch(fetchProducts());
    }

    componentWillReceiveProps(nextProps) {
        const { products, match: { params: { name } } } = nextProps;

        this.setState({
            product: products.filter((h)=> h.getIn(['name'])===name)
        });
    }


    render() {
        const { state: { product } } = this;
        const { match: { params: { name } } } = this.props;
        const general = product.filter(l=>l.get('parent')==0)
        if(product) {
            return (
                <div key={product.get('id')}>
                <Row>
                </Row>
                <div><Link to="/listado">Listado de Productos </Link>
                /{name}
                </div>
                        <Row>
                                <Col className="col-md-2">
                                    <img with="100px" height="100px" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSPN3oYvkvxrwfxhN7Vux6Sb9GQg496-XQOyPkH5ECGSqXD3d3RwQ" /><br/>
                                    <img with="100px" height="100px" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSVvpaY2S1cRd1qGPvtW9DVF3wZLgCPztGmXVYjXtYzNKd4_OId0w" /><br/>
                                    <img with="100px" height="100px" src="data:image/jpeg;base64," /><br/>
                                    <img with="100px" height="100px" src="data:image/jpeg;base64," /><br/>
                                </Col>
                                <Col className="col-md-6">
                                    <img  src="https://static.wixstatic.com/media/3fc0b9_1c07222503fa483894e7b3bcdc9d456c~mv2.jpg/v1/fill/w_498,h_498,al_c,q_90/file.jpg" /><br/>
                                </Col>
                                <Col  className="col-md-4">
                                {general.map(element=>
                                    <div>
                                        <div className="col-md-6">
                                            <h2>{element.get('name')}</h2>
                                            <p style={{opacity: '.50'}}>
                                                <h5>
                                                    CÃ³digo:{element.get('code')}
                                                </h5>
                                            </p>
                                        </div>
                                        <div>
                                        <h5 style={{opacity: '.50'}}>- - - - - - - - - - - - - - - - - - - - - - - - - - -</h5>
                                        </div>
                                        <div className="col-md-6">
                                            <h3>MXN {element.get('amount')}</h3>
                                            <h5>{element.get('description')}</h5>
                                        </div>
                                        <Table>
                                            <thead>
                                                <tr>
                                                    <th>
                                                    Subproductos
                                                    </th>
                                                </tr>
                                            </thead>
                                            <tbody>
                                                <tr>
                                                    {product.filter(l=>
                                                    l.get('parent')>0).map(m=>(
                                                        <div>
                                                            {m.get('variants').map(p=>
                                                                <td>
                                                                    <span className="input-group-addon">{`${p} `}</span>
                                                                </td>
                                                            )}
                                                        </div>

                                                        )
                                                    )
                                                }
                                                </tr>
                                            </tbody>
                                        </Table>
                                    </div>)}
                                </Col>
                        </Row>
                    </div>
            );
        }
        return null;
    };
}

export default connect(selector)(ProductDetail)